void matchesWhenRequiredAbsentCookieIsAbsent(){
    stubFor(
        get(urlEqualTo("/absent/cookie"))
            .withCookie("not_this_cookie", absent())
            .willReturn(aResponse().withStatus(200)));

    WireMockResponse response =
        testClient.get(
            "/absent/cookie",
            withHeader(
                COOKIE,
                "my_cookie=xxx-mycookievalue-xxx; my_other_cookie=exact-other-value; irrelevant_cookie=whatever"));

    assertThat(response.statusCode(), is(200));
  }

void doesNotMatchWhenRequiredAbsentCookieIsPresent(){
    stubFor(
        get(urlEqualTo("/absent/cookie"))
            .withCookie("my_cookie", absent())
            .willReturn(aResponse().withStatus(200)));

    WireMockResponse response =
        testClient.get(
            "/absent/cookie",
            withHeader(
                COOKIE,
                "my_cookie=xxx-mycookievalue-xxx; my_other_cookie=exact-other-value; irrelevant_cookie=whatever"));

    assertThat(response.statusCode(), is(404));
  }
